import React, { useState, useEffect } from 'react';

function CabList({ onCabSelect }) {
    const [cabs, setCabs] = useState([]);

    useEffect(() => {
        // Fetch available cabs from your backend
        fetch('/api/getAllCabStatus')
            .then((response) => response.json())
            .then((data) => setCabs(data.CabStatus))
            .catch((error) => console.error('Error fetching available cabs:', error));
    }, []);

    return (
        <div className="cab-list">
            <h2>Available Cabs</h2>
            <ul>
                {cabs.map((cab, index) => (
                    <li key={index}>
                        {cab.name} - Rate per minute: {cab.rate}
                        <button onClick={() => onCabSelect(cab)}>Select</button>
                    </li>
                ))}
            </ul>
        </div>
    );
}

export default CabList;
